import React from "react";
import FullRecordList from "./FullRecordList";

const Address = (props) => {
  return (
    <div>
      <div style={{ marginTop: '30px' }}>
        <strong>Город: </strong> {props.addr.city}, <strong>улица:</strong> {props.addr.street}, <strong>дом:</strong> {props.addr.house}, <strong>квартира:</strong> {props.addr.office}
      </div>
      <FullRecordList recs={props.addr.full_records} />
    </div>
  );
};

export default Address;
